import java.util.Arrays;
import java.util.Scanner;

class  Main {
    public static void main(String[] args) {
        int gifts = sc.nextInt();
        int papers = sc.nextInt();
        int[] giftArr = new int[gifts];
        int[] paperArr = new int[papers];
        for(int i =0; i<gifts; i++){
            giftArr[i] = sc.nextInt();
        }
        for(int i =0; i<papers; i++){
            paperArr[i] = sc.nextInt();
        }
        Arrays.sort(giftArr);
        Arrays.sort(paperArr);
        int g = 0;
        int p = 0;
        int count = 0;
        while (g < gifts && p < papers) {
            double divide = paperArr[p] * 1.0 / giftArr[g];
            if (divide < 2) {
                p++;
            } else if (divide <= 3) {
                count++;
                p++;
                g++;
            } else {
                g++;
            }
        }
        System.out.println(count);
    }

    static Scanner sc = new Scanner(System.in);
    static StringBuilder sb = new StringBuilder();
}
